If you’re fully committed to your goals that means you’re actively taking the steps towards them. You’re weeding out everything that hasn’t been and isn’t pushing you and you’re actually getting focused. You’re not making excuses like; I don’t have the time right now, I don’t have the money, I’ve got too many things going on, etc. No, you’re saying “this is my goal and I don’t care what stands in my way, I’m getting it!” I could’ve easily said I have too much going on and used that excuse to stop me from choosing my health over everything else. I’m working full time and staying home with my newborn...I’m the definition of strapped for time people 🤣 But you know what, I’m choosing my health for my family over all else. 

If you’re just interested in your goals you’re fooling yourself and those around you. You’re playing games. You’re wasting time. 

If you want that promotion, work for it! Don’t just say “man, I really want to get promoted”, actually put in the work to *earn* it! If you want to lose weight you need to actually work for it. This involves eating healthy and working your body, not just wishing to lose weight. 

Stop wasting your time hoping for things to change and be the driving force to MAKE them change! 
