My plan for tonight was going to be taking a nice long walk and then finishing with a total body workout. But Bug had other plans. 
The past 3 nights, our Bug has been not herself and waking up every 1-2 hours through the night. She spends all day running around completely unaffected but towards the end of the night she won’t eat or leave my side. 
Thankfully she was more than happy to get our walk in but by the time we got home she did a 180. 
This is not me complaining or looking for sympathy. This is simply my reality. Weightlifting and working out is a huge part of my life but being a mother will ALWAYS take priority. 
Send positive vibes our way for a better night. We all could use it. 
Happy Friday Everyone! Have a wonderful and safe long weekend 💕💕
