I’m Jessica! A Vancouver island girl now living in PEI! An island girl at heart, I now feel at home again!

I have 2 kiddos and a husband that I love dearly!  We are just figuring out life as we go and try to enjoy the process.

We bought a house sight unseen during the pandemic and its been a bit of a nightmare but we are slowly pulling it all together which has meant a lot of projects and painting.

I love the beach, kind humans, essential oils, good music and spending time cooking something dairy free in my kitchen!

If you came for tea, we’d probably have some rooibos chai and chat about life. I love getting to know people and hearing their stories!

I love thrifting, cute water bottles, the color turquoise and Ben and Jerry’s non dairy ice cream! 

I have an essential oil business that’s nearing 200 wonderful humans and I’m so grateful for it every day! It gives me life and some purpose. I love to share what I learn too (which you’ll see in my stories).

I’m currently obsessed with Dowton Abbey, my air fryer and dreaming up DIY projects for the Fall!

Grateful you are here and I can’t wait to get to know you all! I’d love to chat anytime. If we have anything, shoot me a DM and let’s chat! 

PS - I’m getting super close to 2k followers and would be so grateful if you would share a post from my feed you love 💗 I will gladly return the favor - just be sure to tag me!

